import React from 'react';
import { NavLink } from 'react-router-dom';

// == Style 
import ProductStyled from './ProductStyled';

const Product = () => {
  return (
    <ProductStyled>
      <div className="fildAriane">
        <NavLink exact to="/catalogue"><img src={process.env.PUBLIC_URL + '/img/arrow.svg'} alt="bouton retour arrière"/></NavLink>
        <p><NavLink exact to="/catalogue">Retour | Catalogue </NavLink>| Féculent | Lentilles corail</p>
      </div>
    </ProductStyled>
  );
};

export default Product;
